  { title: `product`, path: `/product` },
  { title: `blog`, path: `/blog` },
  { title: `contact`, path: `/contact` },
  { title: `faq`, path: `/faq` },]
const Header = () => {
  return (
    <AppBar position="static">
      <Toolbar>asdfds</Toolbar>
    </AppBar>
  )
}
export default Header
